  TextSection:
    Contents: A rare vaginal malformation characterized by congenital uterovaginal
      outflow tract obstruction due to failure of the urogenital sinus to form the
      caudal aspect of the vagina which is then replaced by fibrous tissue. The malformation
      may occur as an isolated developmental defect or in association with other anomalies
      such as cervical agenesis imperforate hymen and bicornuate bicervical uterus.
      Presenting signs and symptoms include primary amenorrhea cyclic pelvic pain
      abdominal pain dyspareunia pelvic mass menstrual disorder and periodic fever.
